" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Pathogenesis of oral allergy syndrome (pollen-food allergy syndrome)",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/41/5785/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/41/5785/contributors\">",
"     Anna Nowak-W��grzyn, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/41/5785/contributors\">",
"     Section Editor",
"    </a>",
