" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Treatment of fibromyalgia in adults not responsive to initial therapies",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/41/5786/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/41/5786/contributors\">",
"     Don L Goldenberg, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?5/41/5786/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?5/41/5786/contributors\">",
"     Peter H Schur, MD",
"    </a>",
"    <br/>",
"   </div>",
